sys_variable_value.value:
(function execute(inputs, outputs) {
	var record = inputs.records;
  	var emails = []	
  while(record.next()){
    	var user = record.user.getRefRecord()
        emails.push(user.getValue('email'))
    }
  outputs.emails = emails
})(inputs, outputs);

